pragma solidity >=0.8.0 <0.9.0;

// Useful for debugging. Remove when deploying to a live network.
import "hardhat/console.sol";

// Use openzeppelin for security
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

// Pyth Oracle Integration
import "@pythnetwork/pyth-sdk-solidity/IPyth.sol";
import "@pythnetwork/pyth-sdk-solidity/PythStructs.sol";

/**
 * MemeVault contract for depositing meme coins and routing to highest yield vaults
 * Integrates Pyth Network for real-time price feeds
 * @author ETHOnline 2025
 */
contract MemeVault is ReentrancyGuard {
    using SafeERC20 for IERC20;

    // State Variables
    address public immutable owner;
    IPyth public pyth;

    // Mapping of token => total deposited
    mapping(address => uint256) public totalDeposits;

    // User deposits: user => token => amount
    mapping(address => mapping(address => uint256)) public userDeposits;

    // Price feed IDs for meme tokens (bytes32)
    mapping(address => bytes32) public tokenPriceFeedIds;

    // Last price update timestamp
    mapping(bytes32 => uint256) public lastPriceUpdate;

    // Events
    event Deposit(address indexed user, address indexed token, uint256 amount, string chain, uint256 timestamp);
    event YieldRouted(address indexed user, address indexed token, uint256 amount, string vault, uint256 apy, string intentId);
    event PriceUpdated(bytes32 indexed priceFeedId, int64 price, uint64 conf, int32 expo);
    event PriceFeedRegistered(address indexed token, bytes32 priceFeedId);

    // Constructor
    constructor(address _owner, address _pythContract) {
        owner = _owner;
        pyth = IPyth(_pythContract);
    }

    /**
     * Deposit meme coins into the vault
     * @param token The ERC20 token address (e.g., PEPE)
     * @param amount Amount to deposit
     * @param chain Target chain for routing (e.g., "Base")
     */
    function deposit(address token, uint256 amount, string memory chain) external nonReentrant {
        require(amount > 0, "Amount must be > 0");
        require(token != address(0), "Invalid token");

        // Transfer tokens from user to contract
        IERC20(token).safeTransferFrom(msg.sender, address(this), amount);

        // Update state
        totalDeposits[token] += amount;
        userDeposits[msg.sender][token] += amount;

        // Emit deposit event
        emit Deposit(msg.sender, token, amount, chain, block.timestamp);

        // Simulate AI routing (in real impl, this would be off-chain)
        _simulateYieldRouting(msg.sender, token, amount, chain);
    }

    /**
     * Simulate yield routing (mock for MVP)
     * In production, this would integrate with Avail intents
     */
    function _simulateYieldRouting(address user, address token, uint256 amount, string memory chain) internal {
        // Mock APY based on chain
        uint256 apy;
        string memory vault;
        if (keccak256(abi.encodePacked(chain)) == keccak256(abi.encodePacked("Base"))) {
            apy = 1200; // 12%
            vault = "BaseMoonwell";
        } else {
            apy = 800; // 8%
            vault = "SepoliaMock";
        }

        string memory intentId = string(abi.encodePacked("intent-", user, "-", token, "-", amount));

        // Emit routing event
        emit YieldRouted(user, token, amount, vault, apy, intentId);
    }

    /**
     * Withdraw deposited tokens (for testing)
     * @param token The token to withdraw
     * @param amount Amount to withdraw
     */
    function withdraw(address token, uint256 amount) external nonReentrant {
        require(userDeposits[msg.sender][token] >= amount, "Insufficient balance");

        // Update state
        userDeposits[msg.sender][token] -= amount;
        totalDeposits[token] -= amount;

        // Transfer back
        IERC20(token).safeTransfer(msg.sender, amount);
    }

    /**
     * Get user deposit balance
     */
    function getUserDeposit(address user, address token) external view returns (uint256) {
        return userDeposits[user][token];
    }

    /**
     * Function that allows the owner to withdraw ETH (for gas refunds)
     */
    function withdrawETH() public {
        require(msg.sender == owner, "Not the Owner");
        (bool success, ) = owner.call{ value: address(this).balance }("");
        require(success, "Failed to send Ether");
    }

    /**
     * Register a price feed ID for a token
     * @param token The token address
     * @param priceFeedId The Pyth price feed ID (bytes32)
     */
    function registerPriceFeed(address token, bytes32 priceFeedId) external {
        require(msg.sender == owner, "Only owner can register price feeds");
        require(token != address(0), "Invalid token");
        tokenPriceFeedIds[token] = priceFeedId;
        emit PriceFeedRegistered(token, priceFeedId);
    }

    /**
     * Update price feeds with latest data from Hermes
     * @param priceUpdateData Array of encoded price updates from Hermes
     */
    function updatePrices(bytes[] calldata priceUpdateData) external payable {
        require(priceUpdateData.length > 0, "No price updates provided");

        // Get the update fee from Pyth
        uint updateFee = pyth.getUpdateFee(priceUpdateData);
        require(msg.value >= updateFee, "Insufficient fee for price update");

        // Update prices on-chain
        pyth.updatePriceFeeds{ value: updateFee }(priceUpdateData);

        // Emit events for tracking
        for (uint i = 0; i < priceUpdateData.length; i++) {
            // Note: In a real implementation, you'd parse the priceUpdateData to get feed IDs
            // For now, we'll just track that prices were updated
        }

        // Refund excess ETH
        if (msg.value > updateFee) {
            (bool success, ) = msg.sender.call{ value: msg.value - updateFee }("");
            require(success, "Refund failed");
        }
    }

    /**
     * Get the current price for a token using Pyth
     * @param token The token address
     * @param maxAge Maximum age of price in seconds
     * @return price The price in format price * 10^expo
     * @return conf The confidence interval
     * @return expo The exponent
     * @return publishTime The publish time of the price
     */
    function getTokenPrice(address token, uint256 maxAge) external view returns (int64 price, uint64 conf, int32 expo, uint publishTime) {
        bytes32 priceFeedId = tokenPriceFeedIds[token];
        require(priceFeedId != bytes32(0), "Price feed not registered for token");

        PythStructs.Price memory pythPrice = pyth.getPriceNoOlderThan(priceFeedId, maxAge);
        return (pythPrice.price, pythPrice.conf, pythPrice.expo, pythPrice.publishTime);
    }

    /**
     * Get price in USD with 8 decimals
     * @param token The token address
     * @param maxAge Maximum age of price in seconds
     * @return priceUsd The price in USD with 8 decimals
     */
    function getTokenPriceUsd(address token, uint256 maxAge) external view returns (uint256 priceUsd) {
        bytes32 priceFeedId = tokenPriceFeedIds[token];
        require(priceFeedId != bytes32(0), "Price feed not registered for token");

        PythStructs.Price memory pythPrice = pyth.getPriceNoOlderThan(priceFeedId, maxAge);

        // Convert to 8 decimals if needed
        if (pythPrice.expo >= -8) {
            priceUsd = uint256(int256(pythPrice.price)) * (10 ** uint32(pythPrice.expo + 8));
        } else {
            priceUsd = uint256(int256(pythPrice.price)) / (10 ** uint32(-pythPrice.expo - 8));
        }

        return priceUsd;
    }

    /**
     * Calculate deposit value in USD using Pyth prices
     * @param token The token address
     * @param amount The amount of tokens
     * @param maxAge Maximum age of price in seconds
     * @return valueUsd The value in USD (8 decimals)
     */
    function getDepositValueUsd(address token, uint256 amount, uint256 maxAge) external view returns (uint256 valueUsd) {
        bytes32 priceFeedId = tokenPriceFeedIds[token];
        require(priceFeedId != bytes32(0), "Price feed not registered for token");

        PythStructs.Price memory pythPrice = pyth.getPriceNoOlderThan(priceFeedId, maxAge);

        // Calculate value: amount * price * 10^expo
        int256 value = int256(amount) * pythPrice.price;

        // Adjust for exponent
        if (pythPrice.expo >= 0) {
            value = value * int256(10 ** uint32(pythPrice.expo));
        } else {
            value = value / int256(10 ** uint32(-pythPrice.expo));
        }

        return uint256(value);
    }

    /**
     * Receive ETH
     */
    receive() external payable {}
}
